import logo from './logo.svg';
import './App.css';
// import {} from '';
function App() {
  return (
    <div className="App">

      <img src={logo} className="App-logo" alt="logo" />
      <h2>
        <code>React Router</code>
      </h2>


    </div>
  );
}

export default App;
